function hideUri(element_id, new_background_url) {
    var blurry_slide = document.getElementById(element_id);
    blurry_slide.style.backgroundImage = 'url(' + new_background_url + ')';
    blurry_slide.classList.remove("blurme");
}

function setUri(element_id) {
	var el = document.getElementById(element_id);
	el.style.backgroundImage = 'url(' + data_uris[element_id] + ')'
}

const data_uris = {
	"visitemail1": 'data:image/png;base64,',
	"bookemail": 'data:image/png;base64,',
	"firstemail": 'data:image/png;base64,',
	"secondemail": 'data:image/png;base64,',
	"flowers": 'data:image/png;base64,',
	"visitemail2": 'data:image/png;base64,'
}